#
# [2258] Escape the Spreading Fire
#

# @lc code=start
from typing import List, Tuple
import numpy as np

class Solution:
    def maximumMinutes(self, grid: List[List[int]]) -> int:
        rl = len(grid[0])
        for row in grid:
            row.insert(0, 2)
            row.append(2)
        grid.insert(0, [2 for _ in range(rl + 2)])
        grid.append([2 for _ in range(rl + 2)])

        self.height = len(grid)
        self.width = len(grid[0])

        grid = np.array(grid)

        # self.reduce_branches(grid)

        grids = self.grid_chain(grid)
        m = len(grids)

        visit_mask = [[0 for j in range(self.width)] for i in range(self.height)]

        for starting_minute in reversed(range(0, m)):
            if self.test_from_minute(starting_minute, 1, 1, grids, visit_mask):
                if starting_minute == m - 1:
                    return 1000000000
                return starting_minute
        return -1
    
        starting_minute = 0
        while starting_minute < m:
            if not self.test_from_minute(starting_minute, 1, 1, grids, visit_mask):
                break
            starting_minute += 1
            # print(starting_minute)
        if starting_minute == m:
            return 1000000000
        return starting_minute - 1

    def reduce_branches(self, grid: List[List[int]]):
        # self.dump_map(grid)
        branches_reduced = True
        while branches_reduced:
            # self.dump_map(grid)
            branches_reduced = False
            for i in range(self.height):
                for j in range(self.width):
                    if (i, j) not in ((1, 1), (self.height - 2, self.width - 2)) and grid[i][j] == 0:
                        open_neighbours = 0
                        for nr, nc in [[-1, 0],[1,0],[0,-1],[0,1]]:
                            if grid[i + nr][j + nc] != 2:
                                open_neighbours += 1
                        if open_neighbours == 1:
                            grid[i][j] = 2
                            branches_reduced = True
        # self.dump_map(grid)

    def grid_chain(self, starting_grid: List[List[int]]) -> List[List[List[int]]]:
        # find original fires
        new_fires = []
        for i in range(self.height):
            for j in range(self.width):
                if starting_grid[i][j] == 1:
                    new_fires.append((i, j - 1))
                    new_fires.append((i, j + 1))
                    new_fires.append((i - 1, j))
                    new_fires.append((i + 1, j))
        grids = [starting_grid]
        fires_queue = [new_fires]
        while len(fires_queue) > 0:
            grid = grids[-1]
            new_grid =  grid.copy()
            if new_grid[-2][-2] == 4:
                new_grid[-2][-2] = 1
            fires = fires_queue.pop(0)
            new_fires = []
            for i, j in fires:
                if grid[i][j] == 0 or grid[i][j] == 5 or grid[i][j] == 4:
                    if grid[i][j] == 5:
                        grid[i][j] = 1
                    if i == self.height - 2 and j == self.width - 2:
                        if grid[i][j] == 0:
                            new_grid[i][j] = 4
                        else:
                            new_grid[i][j] = 1
                            new_fires = []
                            break
                    else:
                        new_grid[i][j] = 1
                    new_fires.append((i, j - 1))
                    new_fires.append((i, j + 1))
                    new_fires.append((i - 1, j))
                    new_fires.append((i + 1, j))
            if len(new_fires) == 0:
                break
            fires_queue.append(new_fires)
            grids.append(new_grid)
            # self.dump_map(new_grid)
        return grids

    def test_from_minute(self, m: int, row: int, col: int, grids: List[List[List[int]]], visit_mask: List[List[bool]]) -> bool:
        # self.dump_map(grid);
        grid = grids[min(m, len(grids) - 1)]
        if grid[row][col] not in [0, 4] or visit_mask[row][col] == 1:
            return False
        if row == self.height - 2 and col == self.width - 2:
            # self.dump_map(grid)
            return True
        visit_mask[row][col] = 1
        result = \
                 self.test_from_minute(m + 1, row + 1, col, grids, visit_mask) or \
                 self.test_from_minute(m + 1, row, col + 1, grids, visit_mask) or \
                 self.test_from_minute(m + 1, row - 1, col, grids, visit_mask) or \
                 self.test_from_minute(m + 1, row, col - 1, grids, visit_mask)
        visit_mask[row][col] = 0
        return result

    def dump_map(self, grid: List[List[int]]):
        for row in grid:
            s = ''
            for col in row:
                s += '  ' if col == 0 else '██' if col == 2 else '<>' if col == 1 else '~~' if col == 4 else '::' if col == 5 else str(col) * 2
            print(s)
        print()

